import React from "react";
import Button from "./button";
const Studentt=(props)=>{
    return(
        <div>
            <h1>{props.item.name} {props.item.surname}</h1>
            <p>{props.item.class}</p>
            <button
            btnText="mehr"
            tip="secondary"
            tiklaninca={()=>{
                alert(props.student.name);
            }}
            />
            <hr/>
        </div>
    )

}







export default Studentt
